import React from "react";
import "./facebox.css";

function Image({ image_Url, box }) {
  return (
    <div className="App">
      <img id = 'inpic'
        className="br3 grow"
        src={ image_Url}
        alt="web-pic"
        width={"500px"}
        height={'auto'}
      />
      <div className="bounding-box" style={{top:box.leftCol, right:box.topro}}></div>
    </div>
  );
}

export default Image;
